export const COLUMNS = [
    {
        Header: 'Position',
   accessor: 'scholarship_name',
    },
    {
        Header: 'URL',
        accessor: 'scholarship_url',
        Cell: e=><a href={e.value}> {e.value}</a>
    },
    
   
    {
        Header: 'Starting date',
        accessor: 'scholarship_Starting_date',
    },
    {
        Header: 'Deadline',
        accessor: 'scholarship_last_data',
    }
    
]
